        console.log(json);
      } catch (error) {
        console.log("error", error);
      }
    };

    fetchData();
  }, []);
  return (
  <div className="App">
    <Routes>
    <p className="App-intro">;{apiResponse}</p>
      <Route path="/" element={ <GenreGenerator/> } />
      <Route path="/playlist" element={ <PlaylistGenerator/> } />
    </Routes>
  </div>
  );

  }
export default App;
